Kabir--> <div class="col-sm-4"> <div class="well" style="overflow: auto; height: 240px; !important; background-color: lightgray"> <div id="General_hover"> <center> <a> <img src="images/people/students/ariyan kabir.png" class="img-responsive" id="myBtn27" alt="Ariyan Kabir" style="width:85%; !important"> </a> <!--name of person 27--> <h5>Ariyan Kabir</h5> </center> </div> <!-- Modal for person 27 --> <div class="modal fade" id="myModal27" role="dialog"> <div class="modal-dialog"> <!-- Modal content for person 27--> <div class="modal-content"> <div class="modal-header"> <button type="button" class="close" data-dismiss="modal">×</button> <h4 class="modal-title">Ariyan Kabir</h4> </div> <div class="modal-body"> <a target="_blank" href="images/people/students/ariyan kabir.png"> <img src="images/people/students/ariyan kabir.png" alt="person 27" alt="Ariyan Kabir" style="width:135px; float: right; margin: 0 0 15px 15px"> </a> <p style="font-size:15px"> <span style="color: #991b1e; font-weight: bold">Title: </span>PhD Student / Graduate Research Assistant<br> <span style="color: #991b1e; font-weight: bold">Research Area: </span>Motion Planning, Machine Learning, Multi-Robot Collaboration, Human Robot Collaboration<br> <span style="color: #991b1e; font-weight: bold">Current Projects: </span> Ariyan is primarily working on Robotic Surface Finishing (cleaning, sanding, etc.) project. He is also working on collaborative robotic assembly, composite lay-up, augmented reality interfaces for robotic assistants, and automatic tool changing mechanism. <br> <br> Email: akabir@usc.edu<br> Website: <a href="https://sites.google.com/view/ariyankabir/" target="Ariyan Kabir">ariyankabir.com</a> </p> </div> <div class="modal-footer"> <button type="button" class="btn btn-default" data-dismiss="modal">Close</button> </div> </div> </div> </div> </div> </div> <!--End of person 27--> <!---------------> <!-- person 22 - Nithyananda Bhat Kumbla --> <div class="col-sm-4"> <div class="well" style="o